import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Nav, Container, NavDropdown } from 'react-bootstrap';

import SearchBox from './SearchBox';
import './Header.css';

const Header = () => {
  return (
    <Navbar bg="light" expand="lg" sticky="top" className="shadow-sm">
      <Container fluid>
        <Navbar.Brand href="/flexc" className="fw-bold text-primary d-flex align-items-center">
          <img
            src="/assests/logo.jpeg"
            alt="FlexC Logo"
            style={{ width: '80px', marginTop: '-5px' }}
          />
        </Navbar.Brand>

        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="me-auto align-items-lg-center ms-lg-3">
            <NavDropdown title="Solutions" id="solutions-dropdown" className="me-lg-2">
              {/* NavDropdown items here */}
            </NavDropdown>
            <Nav.Link href="/aboutus" className="ms-lg-3">About Us</Nav.Link> 
          </Nav>

          <Nav className="ms-auto align-items-lg-center">
            <li className="nav-item me-lg-3">
              <SearchBox />
            </li>
            <Nav.Link href="/auth/signin" className="me-lg-2">Login</Nav.Link>
            <Nav.Link href="/auth/signup" className="me-lg-2">
              <button className="btn btn-primary">Sign up</button>
            </Nav.Link>
            <img src="" alt="avatar" style={{ width: '30px', borderRadius: '50%' }} />
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default Header;
